import React from 'react';
import styles from './Footer.module.css';

const Footer = () => {
  return (
    <div className={styles.footer}>
      &copy; 2023 <span className={styles.span}>Agency</span> All Rights Reserved 
    </div>
  );
};

export default Footer;
